77ea4d245d131575d0986b08e39882d8cf25880d.source:
query MovieDetail($id: Int = 15) {
  movies {
    __typename
    movie(id: $id) {
      __typename
      id
      title
      rating
      poster(size: W500)
      details {
        __typename
        overview
      }
    }
  }
}

6d90aeb2c05244873f6d313e7d2c4edc70fbde4c.source:
query MovieList($limit: Int = 15) {
  movies {
    __typename
    popular(first: $limit) {
      __typename
      edges {
        __typename
        node {
          __typename
          id
          title
          rating
          poster(size: W500)
        }
      }
    }
  }
}
